INSERT INTO `news` VALUES (1,'A 회사: 스마트폰 신제품 출시, 혁신적인 기능 탑재','신제품이 시장에서 큰 호응을 얻어 판매량 급증.','신제품이 예상보다 낮은 판매량 기록, 혁신적인 기능은 과장된 마케팅.',40,-20,'통신'),(2,'A 회사: 대규모 인수합병 발표','인수합병 성공, 새로운 시장 진출 및 수익성 개선.','인수합병 실패, 재무 부담 증가.',35,-25,'통신'),(3,'A 회사: 인공지능 기반 스마트폰 기능 출시','AI 기능 호평, 판매량 급증.','AI 기능 미비, 사용자 불만 증가.',45,-15,'통신'),(4,'A 회사: 글로벌 브랜드 가치 상승','브랜드 가치가 매출에 긍정적 영향, 마케팅 효과 증대.','브랜드 평판에 큰 영향이 없었음.',30,-10,'통신'),(5,'A 회사: 주요 경쟁사 기술 침해 소송에서 승소','경쟁사 주가 하락, A 회사 시장 점유율 확대.','소송에서 패배, 손해배상 문제 발생.',50,-30,'통신'),(6,'B 회사: 철강 원자재 가격 하락으로 비용 절감','원가 절감으로 순이익 증가.','원자재 가격이 다시 상승, 비용 절감 효과 미미.',45,-20,'철강'),(7,'B 회사: 대규모 수출 계약 체결','계약으로 매출 급증, 글로벌 시장 확대.','계약이 파기되거나 규모 축소.',40,-25,'철강'),(8,'B 회사: 친환경 철강 기술 개발 성공','친환경 철강 수요 급증, 시장에서 우위 점유.','기술 개발 지연, 시장 출시 실패.',50,-15,'철강'),(9,'B 회사: 철강업계 규제 완화 기대','규제 완화로 생산성 향상, 비용 절감.','규제 변화 없음, 비용 절감 효과 불확실.',35,-10,'철강'),(10,'B 회사: 주요 생산 시설 확장','생산 능력 증가로 매출 확대.','확장 계획 취소 또는 지연.',40,-30,'철강'),(11,'C 회사: 대규모 태양광 프로젝트 수주','프로젝트 수주로 매출 급증.','수주 계약 취소 또는 지연.',90,-65,'에너지'),(12,'C 회사: 새로운 에너지 저장 기술 개발 성공','기술 도입으로 시장 점유율 확대.','기술 개발 실패, 경쟁사에 뒤처짐.',80,-80,'에너지'),(13,'C 회사: 정부의 재생에너지 지원 강화','정부 지원으로 사업 확장 가속화.','지원 규모 축소 또는 실효성 미비.',75,-85,'에너지'),(14,'C 회사: 글로벌 시장 진출 성공','글로벌 시장에서 수익성 확대.','진출 실패, 현지 규제 문제 발생.',60,-60,'에너지'),(15,'C 회사: 주요 경쟁사 도산','경쟁사 도산으로 시장 점유율 확대.','경쟁사의 재정 회복 또는 소문에 불과.',50,-40,'에너지'),(16,'D 회사: 신형 TV 출시로 시장 점유율 확대','신형 TV가 높은 인기를 얻어 판매량 증가.','신형 TV 판매 저조, 소비자 반응 미흡.',30,-25,'전자제품'),(17,'D 회사: 스마트 가전 기술 혁신 발표','혁신 기술이 가전 시장을 주도.','기술 혁신이 소비자에게 어필하지 못함.',25,-20,'전자제품'),(18,'D 회사: 주요 공급망 문제 해결','공급망 안정화로 생산 비용 절감.','공급망 문제 지속, 생산 차질 발생.',30,-10,'전자제품'),(19,'D 회사: 유럽 시장에서 높은 매출 기록','유럽 시장에서 매출 급증, 수익성 개선.','유럽 매출은 과장되었거나 단기적 성과.',35,-15,'전자제품'),(20,'D 회사: 경쟁사와의 특허 분쟁에서 승소','경쟁사의 제품 판매 중단, 시장 점유율 상승.','분쟁이 해결되지 않거나, D 회사가 패소.',40,-20,'전자제품'),(21,'E 회사: 새로운 반도체 공정 도입 성공','공정 도입으로 생산성 향상, 원가 절감.','공정 도입에 실패하거나, 기술적 문제 발생.',750,-825,'반도체'),(22,'E 회사: 대규모 반도체 수출 계약 체결','수출 계약으로 매출 급증.','계약이 체결되지 않거나, 규모 축소.',540,-215,'반도체'),(23,'E 회사: 글로벌 반도체 시장 점유율 1위 등극','시장 점유율 확대, 경쟁사 제압.','과장된 소문, 실제 점유율 변동 없음.',545,-530,'반도체'),(24,'E 회사: 반도체 가격 인상 발표','가격 인상으로 수익성 개선.','인상 효과 미미, 경쟁사로 고객 이동.',350,-200,'반도체'),(25,'E 회사: 차세대 반도체 기술 특허 획득','특허로 기술적 우위 확보, 경쟁사 압도.','기술 실효성 낮거나, 특허 무효화.',800,-900,'반도체'),(26,'F 회사: 해상 운송 수요 급증으로 매출 대폭 증가','수요 증가로 매출 상승, 수익성 개선.','단기적 수요 증가에 그쳐, 장기적인 효과 미미.',1450,-1500,'물류'),(27,'F 회사: 글로벌 물류망 확장 성공','물류망 확대로 글로벌 시장 점유율 확대.','확장에 실패하거나, 비용 부담 증가.',2500,-2000,'물류'),(28,'F 회사: 새로운 물류 기술 도입 발표','기술 도입으로 운영 효율성 증대, 비용 절감.','기술 도입 실패, 운영 비용 증가.',2400,-2500,'물류'),(29,'F 회사: 주요 항로에서의 운임 인상 발표','운임 인상으로 수익성 대폭 개선.','인상 효과 미미, 고객 이탈 발생.',1350,-2300,'물류'),(30,'F 회사: 경쟁사와의 합병 협상 중','합병 성공으로 시장 지배력 강화.','협상 결렬 또는 합병 실패.',1050,-1200,'물류');
